**EscapeFunction**`<[T]>`

An escape function is a function which takes no parameters and
marks itself by setting the key `escape` to the value **true**.

If this utility is used with a generic it will ensure that the function
has the `escape` property set. If no generic is used then it will just
present a generalized shape for escape functions.
```ts
// () => string & {escape: true}
type Esc = EscapeFunction<() => string>;
// () => unknown & {escape: true}
type Esc2 = EscapeFunction;
```

**Keys**`<TContainer>`

Provides the _explicit keys_ of a container `TContainer` as an array of values.

```ts
type Obj = { foo: 1, bar: 2, [key: string]: unknown };
type Arr = [1,2,3];
// readonly ["foo", "bar"]
type K1 = Keys<Obj>;
// readonly [0,1,2]
type K2 = Keys<Arr>;
```

**Related:** `ValidKey`, `PublicKeys`

The mapping function provided by the `mapFn()` utility. This _fn_
is intended to be used in two ways:

1. Iterative:
   ```ts
   const m = mapTo<I,O>(i => [ ... ]);
   // maps inputs to outputs
   const out = inputs.map(m);
   ```
2. Block:
   ```ts
   // maps inputs to outputs (filtering or splitting where appr.)
   const out2 = m(inputs);
   ```

**KindError**

An error which:

- must have a "kind" type defined which can be used to categorize the error
- is allowed to express other key/value pairs in the `context` property

This error is generated with the `kindError(kind, _defineContext) => (msg, ctx)`
higher order function.

```ts
// Defines the Error
const BadJuju = kindError("bad-juju", { flavor?: "" });
// BadJuju {
//     name: BadJuju;
//     kind: "bad-juju";
//     msg: "oh my god!";
//     context: { flavor?: string}
// }
BadJuju("oh my god!");
BadJuju("oh my god!", { flavor: "strawberry"})
```

**NarrowingFn**`<N>`

Produces a function which helps to narrow down to the type passed in 
by assigning generics to all input parameters.

```ts
// <T extends string>(name: string) => string
type Fn1 = NarrowingFn<(name: string) => string>;
// <T extends number>(v: T) => T
type Fn2 = NarrowingFn<number>;
// <T extends number>(v: T) => T
type Fn2 = NarrowingFn<42>;
```

**Related:** `LiteralFn`, `IsNarrowingFn`

**WithValue**`<TObj,TValue>`

Reduces an object's type down to only those key/value pairs where the
value is of type `W`.
```ts
const foo = { a: 1, b: "hi", c: () => "hello" }
// { c: () => "hello" }
type W = WithValue<typeof foo, Function>
```

**Related:** `WithoutValue`, `WithKeys`, `WithoutKeys`

**WithoutValue**

Reduces an object's type down to only those key/value pairs where the
value is **NOT** of type `W`.

```ts
const foo = { a: 1, b: "hi", c: () => "hello" }
// { a: 1, b: "hi" }
type W = WithValue<Function, typeof foo>
```

You manually exclude keys as well by setting the optional `E` generic.

**WithKeys**`<T,K>`

This type utility will ensure that the type `T` will _retain_ the key/value 
pairs which extend `K`.

It is very similar to **Pick** but rather `K` being restricted to
being a string union, wth **WithKeys** you can use the union type
or a readonly array of strings.

```ts
type Test = { foo: 1, bar: number, baz: string };
// { foo: 1, bar: number }
type T1 = WithKeys<Test, "foo" | "bar">; // Pick syntax
type T2 = WithKeys<Test, ["foo", "bar"]>;
```

**WithDefault**`<TVal,TDef>`

Provided a type `TVal`, this utility will proxy any value which is
_not_ `null` or `undefined` through as `TVal`; otherwise it will 
substitute in `TDef`.

**Note:** you may optionally set the criteria for using the default
value from `null` or `undefined` to any _falsy_ value.

### Examples
```ts
// "foo"
type T1 = WithDefault<"foo","bar">;
// "bar"
type T2 = WithDefault<null,"bar">;
// "bar"
type T3 = WithoutDefault<"", "bar", "falsy">;
```

**ValueCallback**`<TVal, TReturn>`

A type utility to build a simple "value callback".

```ts
// <V extends string>(v: V) => `hi ${string}`;
type T = ValueCallback<string, `hi ${string}`>;
```

**UniqueKeysUnion**`<L,R>`

Provides a **LeftRight** tuple which articulates the 
_unique_ keys to each container's keys. 

The keys for each sides unique values are represented
as a union type.

```ts
type Foo = { foo: 1; bar: 2 };
type Baz = { bar: 5; baz: 42, extra: "why not?" };
// [ "foo", "baz" | "extra" ]
type U = UniqueKeys<Foo,Baz>;
```

**Related:** `UniqueKeys`

**UnionWithAll**`<TList,TUnion>`

Type utility which iterates through each element of `TList` and creates a 
a union between the current value and `TUnion`.
```ts
type Arr = [1,2,"foo"];
// [1,2, "foo" | number]
type Num = UnionWithAll<Arr, number>;
```

Converts a Tuple type into a _union_ of the tuple elements

```ts
const arr = [1, 3, 5] as const;
// 1 | 3 | 5
type U = TupleToUnion<typeof arr>;
```

**Note:** an empty array will be converted to a `string` type.

**Tuple**`<TType,TLength>`

As a default, a **Tuple** is represented as a readonly array of _unknown_ properties.

- by expressing `TType` you can state either a constant type _or_ a list of types
- by expressing `TLength` it will make the tuple a fixed length (assuming that `TType`
is set to a constant value rather than as a list)
```ts
// readonly unknown[]
type T1 = Tuple;
// readonly [string, string, string, string]
type T2 = Tuple<string, 4>;
```

Trims off whitespace on left of string
```ts
// "\n foobar"
type T = TrimRight<"\n foobar \t">;
// string
type T = TrimRight<string>;
```

Trims off whitespace on left of string
```ts
// "foobar "
type T = TrimLeft<"\n\t  foobar ">;
// string
type T = TrimLeft<string>;
```

Trims off blank spaces, `\n` and `\t` characters from both sides of a _string literal_.
```ts
// "foobar"
type T = Trim<"\n\t  foobar ">;
// string
type T = Trim<string>;
```

**Surround**`<TContent,TPrefix,TPostfix>`

Receives content -- either a string or an array of strings -- and then
proceeds to _surround_ the content with the prefix and postfix content.

```ts
// "(hi)"
type T1 = Surround<"hi", "(", ")">;
// [ "<one>", "<two>" ]
type T2 = Surround<["one","two"], "<",">">;
```

**StripEnding**`<TContent, TStrip>`

Will strip off `TStrip` from the ending of `TContent` when
it is found.

```ts
type T = "Hello World";
type U = " World";
// "Hello"re
type R = StripEnding<T,U>;
```

**StripLeading**`<T, U>`

Will strip off of `T` the starting string defined by `U` when
both are string literals.
```ts
type T = "Hello World";
type U = "Hello ";
// "World"
type R = StripLeading<T,U>;
```

Note:
  - if `T` is a non-string type then no transformation will be done
  - same applies to `U`

**StringLiteralFromTuple**`<T>`

Receives a tuple and creates a string literal type based
on the sequence of elements in the tuple.

```ts
// `${string}(${number})${string}`
type Lit=StringLiteralFromTuple<[
 string, "(", number, ")", string
]>;
```

Type utility that provides the _length_ of a given string type in a way which
is _not_ limited to TS's recursive string length of roughly 48.

```ts
// 3
type Three = StringLength<"foo">;
```

**SnakeCase**`<TString,TPreserve>`

Converts a string literal type to _snake_case_ and optionally preserves
surrounding whitespace.
```ts
// "foo_bar"
type T = SnakeCase<"fooBar">;
type T = SnakeCase<"\n foo bar \t">;
```

**SingularNoun**`<T>`

Type utility which provides an _identity_ mapping to `T` for singular nouns but maps
to _never_ in all other cases.

Singular nouns are words which contain only `Alpha` characters and end in one of the
character sequences specified in `SingularNounEnding`.

```ts
// never
type T1 = SingularNoun<"foobar">;
// rush
type T2 = SingularNoun<"rush">;
```

**Related:** `IsSingularNoun`

**SharedKeys**`<A,B>`

Given two objects `A` and `B`, this type utility will provide the 
_keys_ which both objects contain.
```ts
type O1 = { foo: 1; bar: 2; baz: 88 };
type O2 = { bar: 5; baz: 3; nada: true };
//  ["bar", "baz"]
type X = SharedKeys<O1,O2>;
```

**Note:** this is now just an alias to `IntersectingKeys`

For a two-dimensional array, returns a _union type_ which combines the first element of the interior
array.

```ts
// 1 | 2
type F = SecondOfEach<[ ["foo", 1], ["bar", 2] ]>;
```

Provides the _left_ whitespace of a string
```ts
// "\n\t "
type T = LeftWhitespace<"\n\t foobar">;
```

Given a dictionary of type `<T>`, this utility function will
make the `<R>` generic property _required_ (use a union to make
more than one prop required).

```ts
// { foo: string, bar?: number }
type Example = RequireProps<{foo?: string, bar?: number}, "foo">;
```

**ReplaceAll**`<TText,TFind,TReplace>`

Type utility which takes a string `TText` and finds _all_ instances of
`TFind` and replaces it with `TReplace`.

```ts
const fooy = "fooy";
// "Foo"
type Foo = Replace<typeof fooy, "y", "">;
```

**Related:** `Replace`

**Replace**`<TText,TFind,TReplace>`

Type utility which takes a string `TText` and finds the first instance of
`TFind` and replaces it with `TReplace`.

```ts
const fooy = "fooy";
// "Foo"
type Foo = Replace<typeof fooy, "y", "">;
```

**Related:** `ReplaceAll`

**RemoveIndexKeys**`<T>`

Removes _index_ keys which permit key/values to be added to an object while
retaining all explicit key/values defined on an object.

```ts
type Obj = { [key: string]: unknown; foo: 42 };
// { foo: 42 }
type Obj2 = RemoveIndexKeys<Obj>;
```

**RemoveIndex**`<T>`

Removes an index like below while retaining other key/value pairs.
```ts
interface Foo {
   foo: string;
   [key: string]: any;
}
// { foo: string }
type T = RemoveIndex<Foo>;
```

**PriorDigit**`<T>`

Given a numeric digit, this utility provides the next numeric digit in sequence.

- this includes the overflow condition of `0` -> `9`
- a string literal digit can be passed in as well and the next string literal
digit will be returned
```ts
// 4
type N = PriorDigit<5>;
// "4"
type S = PriorDigit<"5">;
```

Converts a string literal type to a **PascalCase** representation.
```ts
// "FooBar"
type T = PascalCase<"fooBar">;
type T = PascalCase<"foo-bar">;
type T = PascalCase<"foo_bar">;
type T = PascalCase<"\n foo_bar \t">;
```

**NumericRange**`<TLow,THigh>`

Creates a union type of numbers between `TLow` and `THigh`

```ts
// 2 | 3 | 4 | 5 | 6 | 7
type Range = NumericRange<2,7>;
```

**NumericKeys**<`TList`>

Will provide a readonly tuple of numeric keys for 
a given literal array and an empty array otherwise.

```ts
type Arr = ["foo", "bar", "baz"];
// readonly [0, 1, 2]
type T = NumericKeys<Arr>;
```

**Related:** `Keys`

**Not**`<T,[TError]>`

A boolean negation that can work on both a single value or an
tuple of values.

```ts
// false
type Single = Not<true>;
// [ false, true, boolean ]
type Multi = Not<[true,false,boolean]>;
```

**NextDigit**`<T>`

Given a numeric digit, this utility provides the next numeric digit in sequence.

- this includes the overflow condition of `9` -> `0`
- a string literal digit can be passed in as well and the next string literal
digit will be returned
```ts
// 5
type N = NextDigit<4>;
// "5"
type S = NextDigit<"4">;
```

**MutablePropsExclusive**`<T,M>`

Given a dictionary of type `<T>`, this utility function will
make the properties represented by `M` _mutable_ and all others
immutable.

```ts
// { foo: string, readonly bar: number, readonly baz: number }
type Example = MutableProps<{
   readonly foo: string,
   bar?: number,
   readonly baz: number
}, "foo">;
```

**Related:** `MutableProps`

**MakePropsMutable**`<TObj,TMutProps>`

Given a dictionary of type `<TObj>`, this utility function will
make the properties of `TMutProps` _mutable_. `TMutProps` can be
a union type (as shown below) or a union.

```ts
// { foo: string, bar?: number, readonly baz: number }
type Example = MutableProps<{
   readonly foo: string,
   bar?: number,
   readonly baz: number
}, "foo" | "bar">;
```

**Related:** `MutablePropsExclusive`

Provides the _left_ whitespace of a string
```ts
// "\n\t "
type T = LeftWhitespace<"\n\t foobar">;
```

**KvTuple**

a key/value of type `T` represented as `[key, kv]`

```ts
type Obj = { foo: 1, bar: "hi" };
// ["foo", { foo: 1 } ]
type Foo = KvTuple<Obj, "foo">;
```

**Note:** _consider use of `KeyValue<T,K>` as an alternate representation_

Type utility which takes an object type and converts to an array of KV objects:
```ts
// [ {key: "id", value: 123 } | {key: "foo", value: "bar" } ][]
type Arr = KvFrom<{ id: 123, foo: "bar" }>;
```

Provides a strongly typed _key_ and _value_ for a dictionary `T`

```ts
type Obj = { foo: 1, bar: "hi" };
// ["foo", 1 ]
type Foo = KeyValue<Obj, "foo">;
```

**KeysWithoutValue**`<TObj, TValue>`

The _keys_ on a given object `T` which _do not_ extend the type value of `W`.

```ts
// "foo"
type T = KeysWithoutValue<{ foo: "hi"; bar: 5; baz: number }, number>;
```

**KebabCase**`<TString,TPreserve>`

Converts a string literal into a `kebab-case` format while optionally
allowing surrounding whitespace.

```ts
// "foo-bar"
type Dash = Dasherize<"foo_bar">;
type Dash = Dasherize<"fooBar">;
type Dash = Dasherize<"FooBar">;
// "\n  foo-bar \t"
type Dash = Dasherize<"\n  foo bar \t">;
```

**IsTrue**`<T,[TNever]>`

Type utility which checks for the narrow type of `true`
```ts
// true
type T = IsTrue<true>;
// false
type U = IsTrue<boolean>;
// false
type F2 = IsTrue<"foobar">;
```

**IsFalse**`<T>`

Type utility which checks for the narrow type of `false`
```ts
// true
type T = IsFalse<true>;
// false
type U = IsFalse<boolean>;
type F2 = IsFalse<"foobar">;
```

Returns true or false value based on whether the string literal is capitalized.
```ts
// true
type T2 = IsCapitalized<"One">;
// false
type T1 = IsCapitalized<"one">;
// "unknown"
const a: string = "Hi";
type T3 = IsCapitalized<typeof a>;
```

Note: _if the value passed in is a "string" then the result will be "unknown"_

**IsAllLowercase**`<T>`

Boolean operator which indicates whether `T` has _all_ lowercase characters in it.
Valid values are:

- note: any non-alphabetic characters are ignored in the evaluation

```ts
// true
type T = AllCaps<"foobar">;
// false 
type T = AllCaps<"FooBar">;
// boolean
type T = AllCaps<string>;
```

**IsAllCaps**`<T>

Boolean operator which returns _true_ when `T` consists of ALL capital letters.

- Note: non-alphabetic characters are ignored by this utility

```ts
// true
type T = AllCaps<"FOOBAR">;
type T2 = AllCaps<"FOOBAR2">;
// false 
type T = AllCaps<"FooBar">;
// boolean
type T = AllCaps<string>;
```

**Related:** `IsAllLowercase`

**IntersectWithAll**`<TList,TIntersection>`

Type utility which iterates through each element of `TList` and intersects
the current value with `TIntersection`.

- all intersections which evaluation to `never` are removed from the list
```ts
type Arr = [1,2,"foo"];
// [1,2]
type Num = IntersectWithAll<Arr, number>;
```

**IndexableObject**`<[TObj], [TIndex]>`

Type utility which receives a `KV` object and and adds an _index signature_
so that other properties may be added in the runtime.

- by default the index signature is `{ [key: string]: unknown; [key: symbol]: unknown }`
but this can be changed by changing `TIndex`

```ts
// { [x: string]: unknown; foo: 1; bar: 2 }
type FooBarIdx = IndexableObject<{foo: 1; bar: 2}, KV<string>>;
```

**Related:** `EmptyObject`, `IndexedObject`

**Increment**`<T>`

Allows a number -- or a string literal of a number -- to be _incremented_
by one.
```ts
// 2
type T = Increment<1>;
// "2"
type T = Increment<"1">;
```

Indicates whether `T` has uppercase characters in it.
```ts
// true
type T = HasUppercase<"Foobar">;
// false 
type T = HasUppercase<"foobar">;
// "unknown"
type T = HasUppercase<string>;
```

**HasParameters**`<T>`

Type utility which detects if `T` is both a function and whether that
function has at least one type parameter.
```ts
const fn = (foo: string) => `${foo}bar`;
// true
type P = HasParameters<typeof fn>;
```

Typescript utility which receives `T` as shape which resembles `DictArray<D>`
and if the type `D` can be inferred it is returned.
```ts
// { foo: 1; bar: "hi" }
type Dict = FromDictArray<[["foo", { foo: 1 }], ["bar", { bar: "hi" }]]>;
```

**EnsureTrailing**`<TContent, TTrailing>`

Will ensure that `T` ends with the substring `U` when
both are string literals.

```ts
type T = "Hello";
type U = " World";
// "Hello World"
type R = EnsureTrailing<T,U>;
```

**DropChars**`<TContent,TDrop>`

Removes all character sequences found in `TDrop` from the string content
in `TContent`. If you use a _union_ type for `TDrop` then each of the
union members will be extracted (but union member must only be a single
character).

```ts
// "foobarbaz"
DropChars<"foo, bar, baz", ", ">;
// "oo, ar, az"
DropChars<"foo, bar, baz", "f" | "b">;
```

**Digitize**`<T>`

Takes a literal value of a number -- either a numeric literal or a string literal
is accepted -- and converts into a tuple: `[ NumericSign, Digits[] ]`
```ts
// ["+", readonly [1,2,3] ]
type N = Digitize<123>;
// ["-", readonly ["1","2","3"] ]
type S = Digitize<"-123">;
```

Allow a dictionary to have it's value's type changed to `T` while maintaining the keys in
the original object `I` so long as the original value for the KV pair extends `V`.

If `V` is not specified then it defaults to _any_ and therefore all KVs are preserved.

```ts
type Obj = { foo: "hello", bar: 42, baz: () => "world" };
// { foo: number, bar: number, baz: number };
type AllNumbers = DictChangeValue<Obj, number>;
// { foo: number }
type StringToBool = DictChangeValue<Obj, boolean, string>
```

**ContainerKeyGuarantee**`<TContainer,TKey,[TType]>`

Returns the `TContainer` value intersected with a guarantee that the
`TKey` key value exists.
```ts
// { foo: 1; bar: unknown }
type TO = ContainerKeyGuarantee<{foo: 1}, "bar">;
// number[] & readonly [unknown,unknown,unknown]
type TA = ContainerKeyGuarantee<number[], 2>;
```

- by default the guarantee is provided by assigning the `unknown`
type but you can override this by setting `TType`

**ContainerBlockKey**`<TContainer,TKey>`

Returns the `TContainer` value intersected with a guarantee that the
`TKey` key value exists.
```ts
// { foo: 1; bar: unknown }
type TO = ContainerBlockKey<{foo: 1}, "bar">;
// number[] & readonly [unknown,unknown,unknown]
type TA = ContainerBlockKey<number[], 2>;
```

**Concat**`<T>`

A type utility which converts an array of strings into a
_concatenated_ string type.

```ts
// `${string}-${string}`
type T1 = Concat<string, "-", string>;
// `foo-bar-baz`
type T2 = Concat<"foo", "-", "bar", "-", "baz">;
```

**Related:** `Join<TArr,TWith>`

**Comparison**`<TOp,TArgs>`

A strongly typed comparison which can be used in runtime utilities
like `filter`, `retain`, and `map`.

- typically generated with the `createComparison(op,...params)` runtime utility.

```ts
// Comparison<"equals",[true]>
const isTrue = createComparison("equals", true);
//
const filtered = filter(isTrue)(listOfStuff);
```

**Break<T,D>**

Takes a string `T`, and splits it into a tuple of the form `[F, R]`.
```ts
// ["the", " long and winding road"]
type T1 = Break<"the long and winding road", " ">;
// ["there", " I was, there I was"]
type T2 = Break<"there I was, there I was", " ">;
```

**Related:** `Split`

**ArrayElementType**`<T>`

Determines what type the elements in an array are.
```ts
// string
type T = ArrayElementType<string[]>;
```

**AreSameType**`<A,B>`

Tests whether `A` and `B` are the same _wide_ type.

- Note: for containers, the types are rolled up to the broad category of
container (e.g., Dictionary, Tuple, Map, Set, WeakMap)

```ts
// true
AreSameType<"foo","bar">;
// false
AreSameType<"foo",42>;
```
